description:
Days Missing Vol. 1 - Collected Edition

English | CBR | 1 Issue

Genre: Science Fiction

Written Phil Hester
Art by Frazer Irving

Collects Days Missing Vol. 1 #1-5!

Includes a cover gallery and sketchbook. Includes an introduction by Warren Ellis! 

Since the dawn of time, a being has existed who has shaped human development. His powers have allowed him to secretly remove certain critical days from the historical record, and those events have never been told. But the occurrences of these days have forever changed the course of humanity's evolution. These are the Days Missing from our existence, and they are about to be revealed!

